css:
.nuclide-type-hint-overlay {
  background: #ccdce0;
  box-shadow: 0px 1px 4px 0px #000000;
  color: #676767;
  font-family: Menlo, Monaco, Consolas, monospace;
  font-size: 12px;
  padding: 4px 10px;
  position: relative;
  white-space: nowrap;
}
.nuclide-type-hint-expandable-chevron {
  cursor: pointer;
}
.nuclide-type-hint-text-editor-container {
  display: flex;
  flex-grow: 1;
  max-width: 60em;
}
.nuclide-type-hint-text-editor atom-text-editor {
  background-color: transparent;
  min-width: 1em;
  padding: 2px 0 2px 4px;
}
.nuclide-type-hint-text-editor atom-text-editor::shadow .editor-contents--private {
  cursor: inherit!important;
}
.nuclide-type-hint-text-editor atom-text-editor::shadow .scroll-view .horizontal-scrollbar {
  display: none;
}
.nuclide-type-hint-text-editor atom-text-editor::shadow .scrollbar-corner {
  display: none;
}
atom-text-editor::shadow .nuclide-type-hint-highlight-region > .region {
  background: rgba(97, 146, 158, 0.08);
}
